import React from "react";
import Card from "@mui/material/Card";
import SoftBox from "components/SoftBox";
import SoftTypography from "components/SoftTypography";
import SoftInput from "components/SoftInput";
import SoftButton from "components/SoftButton";
import { Icon, TextField } from "@mui/material";

const Infleta = () => {
  return (
    <Card>
      <SoftBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <SoftBox>
          <SoftTypography variant="h6" gutterBottom>
            ¿Cuotas o Contado?
          </SoftTypography>
          <SoftBox display="flex" alignItems="center" lineHeight={0}>
            <Icon
              sx={{
                fontWeight: "bold",
                color: ({ palette: { info } }) => info.main,
                mt: -0.5,
              }}
              fontSize="large"
            >
              price_change
            </Icon>
            <SoftTypography variant="button" fontWeight="regular" color="text">
              &nbsp;<strong> Toma decisiones financieras inteligentes:</strong> calcula qué opción
              te beneficia más, cuotas o contado.
            </SoftTypography>
          </SoftBox>
        </SoftBox>
        <SoftBox color="text" px={2}>
          <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small">
            restart_alt
          </Icon>
        </SoftBox>
      </SoftBox>
      <SoftBox>
        <SoftBox component="form" role="form" display="flex" flexDirection="column" p={3}>
          <SoftBox mb={2}>
          <TextField id="filled-basic" label="Cuotas" variant="filled" />
          <TextField id="filled-basic" label="Cuotas" variant="filled" />
          <TextField id="filled-basic" label="Cuotas" variant="filled" />
          <TextField id="filled-basic" label="Cuotas" variant="filled" />
          </SoftBox>
        </SoftBox>
      </SoftBox>
    </Card>
  );
};

export default Infleta;
